                // hide workOrderDetails
                $('#partWorkOrders').fadeOut();
                $('#partOrders').show();

                var Id = $(""#PartMasterId option:selected"").val();
                if (Id == '') {
                    $('#partOrders').html('');
                    return;
                }

                var year = $(""#Year option:selected"").val();
